script: |
  super -f text -I q7126.spq | sort > q7126.out

inputs:
  - name: q7126.spq
    data: |
      SELECT DISTINCT - 33, - 30 AS col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q7126.out
    data: |
      -33	-30
